import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";

function Home() {
  const {setPagination} = useContext(AppContext)
  const navigate = useNavigate();
  function previous() {
    setPagination((i) => (i -= 1));
    navigate('/login')
    // acsess to settings
  }
  function next() {
    setPagination((i) => (i += 1));
    navigate('/babyplanner')
  }
  return (
    <div>Home
      <div className="buttons">  
          <button onClick={previous} className="btn1">

          </button>
          <button onClick={next} className="btn2">
            Babyplanner
          </button>
          </div>
    </div>
  )
}

export default Home
